import styled from 'styled-components';

const Container = styled.div`
  width:100%;
  max-width:900px;
  margin:0 auto;
  float:none;
  background: #fff;
  border-right: 1px solid rgba(98, 87, 163, 0.3);
  border-left: 1px solid rgba(98, 87, 163, 0.3);
  height:100vh;
  overflow:hidden;
`;

export default Container;
